INSERT INTO `llx_ticket` (`rowid`, `entity`, `ref`, `track_id`, `fk_soc`, `fk_project`, `origin_email`, `fk_user_create`, `fk_user_assign`, `subject`, `message`, `fk_statut`, `resolution`, `progress`, `timing`, `type_code`, `category_code`, `severity_code`, `datec`, `date_read`, `date_close`, `notify_tiers_at_create`, `email_msgid`, `tms`, `import_key`) VALUES
(12, 1, 'TS2112-0005', 'id92os6fckkg37n9', 16, NULL, NULL, 19, 19, 'IMPRIMANTE PF AZUR 79', 'l\'imprimante scanner des Pompes Funèbres Azur s\'est déconnectée de l\'ordi. tout essayé: débrancher l\'ordi, l\'imprimante...reparamétrer, impossible de la connecter. Ils ont deux imprimantes qui ont le même problème.\r\nSe dépanne en attendant avec celle des ambu pour scanner les documents en faisant les allers retours ou en utilisant leur téléphone.\r\nManu les a déjà dépanné à distance une fois pour le même problème', 8, NULL, '100', NULL, 'REQUEST', 'INTERIEUR', 'HIGH', '2021-12-28 16:52:21', NULL, '2022-01-04 17:13:12', 0, NULL, '2022-01-04 16:13:12', NULL),
(18, 1, 'TS2201-0009', 'ioy1qo91xia7fp1n', 27, NULL, 'beatriceambu17@orange.fr', NULL, 5, 'team connect', 'Nous avons un PDA sur le point de rendre l\'âme et n\'en n\'avons plus en réserve. Il en faudrait 3 afin de palier au plus urgent\r\nMerci', 8, NULL, '100', NULL, 'PROJECT', 'INTERIEUR', 'BLOCKING', '2022-01-06 12:16:16', NULL, '2022-01-06 17:18:22', 1, NULL, '2022-01-06 16:18:22', NULL),
(24, 1, 'TS2201-0015', 'qzuhrh4vta25a45w', 18, NULL, 'pompesfunebres.alter@gmail.com', NULL, 5, 'DOUBLE LIGNE', 'Renvoi double appel encore désactivé.\r\nJe ne reçois pas les communications si je suis déjà en ligne avec un client.\r\nRisque de louper un appel ou de perdre un décès.', 8, NULL, '100', NULL, 'PROJECT', 'INTERIEUR', 'BLOCKING', '2022-01-13 15:58:45', NULL, '2022-01-14 08:33:46', 1, NULL, '2022-01-14 07:33:46', NULL),
(28, 1, 'TS2201-0019', 'ag42h3gcia8jt6lw', 31, NULL, 'ambulances.saintbernard@wanadoo.fr', NULL, 5, 'Ordinateur lent', 'Bonjour,\r\n\r\nLe second ordinateur de la régulation est très lent, c\'est une catastrophe.\r\n\r\nMerci,\r\nCéline', 8, NULL, '100', NULL, 'REQUEST', 'INTERIEUR', 'HIGH', '2022-01-14 10:10:51', NULL, '2022-02-03 17:09:06', 1, NULL, '2022-02-03 16:09:06', NULL),
(33, 1, 'TS2201-0022', '8auh8ucrdsnj7tas', NULL, NULL, 'ambulances.noel.montendre@wanadoo.fr', NULL, 5, 'problème standard', 'Le renvoi d\'appel ne passe pas. Il y a des appels qui tombent sur le portable, d\'autres sur le standard. On ne reçoit pas tout les appels', 8, NULL, '100', NULL, 'PROJECT', 'INTERIEUR', 'BLOCKING', '2022-01-17 09:02:50', '2022-01-17 17:30:54', '2022-01-17 17:34:32', 1, NULL, '2022-01-17 16:34:32', NULL),
(34, 1, 'TS2201-0023', '4puuhyjk1n5q8mt9', 2, NULL, 'lespompesfunebresdeleurop123@orange.fr', NULL, 5, 'AFFICHAGE DES NUMEROS', 'Sur la ligne du 05 45 91 34 50 l\'affichage des numéros ne se fait plus (uniquement sur mon poste)', 8, NULL, '100', NULL, 'PROJECT', 'INTERIEUR', 'NORMAL', '2022-01-18 14:58:52', NULL, '2022-02-04 10:28:21', 1, NULL, '2022-02-04 09:28:21', NULL),
(40, 1, 'TS2201-0028', 'wkchtoepm4cjes6s', NULL, NULL, 'fannyambuetoile@gmail.com', NULL, 5, 'dossier de partgae', 'Bonjour, je ne peux pas ouvrir le dossier de partage.', 8, NULL, '100', NULL, 'REQUEST', 'INTERIEUR', 'HIGH', '2022-01-19 12:28:25', '2022-01-19 16:03:59', '2022-01-19 16:18:15', 1, NULL, '2022-01-19 15:18:15', NULL),
(44, 1, 'TS2201-0029', 'u1eb6ytvjb8hiygq', 41, NULL, 'amb.asur@wanadoo.fr', NULL, 5, 'CARTE SIM POUR PDA + PDA', 'Bonjour,\r\n\r\nIl nous faudrait des PDA d\'avance ainsi qu\'un carte SIM ca nous avons un ambulancier qui n\'a pas de PDA actuellement et ça pose problème pour la régulation.\r\n\r\nMerci à l\'avance\r\n\r\nAngélique', 8, NULL, '100', NULL, 'PROJECT', 'INTERIEUR', 'HIGH', '2022-01-20 13:54:20', NULL, '2022-02-03 17:10:16', 1, NULL, '2022-02-03 16:10:16', NULL),
(46, 1, 'TS2201-0030', 'a3n43dsfc7vpbsu5', 15, NULL, 'amb.asur@wanadoo.fr', NULL, 9, 'DISFONCTIONNEMENT DES CLIMATISATIONS / CHAUFFAGES', 'BUREAU DES POMPES FUNEBRES RUE DR BRILLAUD 79300 BRESSUIRE\r\n\r\nAccumulation de gel sur les ventilateurs extérieurs. Plus du tout de chauffage en salle famille et occasionnellement dans les autres salles.\r\nToujours des messages d\'erreurs.\r\n\r\nAngélique C.', 1, NULL, '0', NULL, 'HELP', 'EXTERIEUR', 'HIGH', '2022-01-20 15:26:07', '2022-02-01 17:29:40', NULL, 1, NULL, '2022-02-01 16:29:40', NULL),
(47, 1, 'TS2201-0031', '1vt6bdv7jz3cn9h2', 15, NULL, 'amb.asur@wanadoo.fr', NULL, 5, 'PROBLEME D\'IMPRESSION PC PORTABLE PF AZUR', 'BUREAU DES POMPES FUNEBRES AZUR RUE DU DR BRILLAUD 79300 BRESSUIRE\r\n\r\nPlus la possibilité d\'imprimer du PC portable noir sur l\'imprimante BROTHER du bureau. Pour info, la personne qui a remplacé MANU pendant ces congés, a du réinstaller un nouveau logiciel d\'impression sur le pc fixe, qui fonctionne parfaitement.\r\n\r\nMerci\r\n\r\nAngélique', 8, NULL, '100', NULL, 'REQUEST', 'INTERIEUR', 'HIGH', '2022-01-20 15:35:06', NULL, '2022-02-04 10:45:58', 1, NULL, '2022-02-04 09:45:58', NULL),
