(179, 1, 'TS2202-0159', 'oura81b19h7r4oyy', 11, NULL, 'godrie-thenaud@orange.fr', NULL, 56, 'CASE', 'Bonjour, \r\n\r\nLa case réfrigérée est très rouillée, et nous avons constaté qu\'elle s\'était fissurée sur le bas ...\r\n\r\nPeut-on envisager dans un premier temps la pose d\'une bande adhésive ou autre ?\r\n\r\nJe vous remercie, \r\n\r\nMélissa', 2, NULL, '0', NULL, 'HELP', 'INTERIEUR', 'NORMAL', '2022-02-16 09:27:55', '2022-02-18 18:19:06', NULL, 1, NULL, '2022-02-18 17:19:08', NULL),
(180, 1, 'TS2202-0160', 'pu9lts5kilfc871r', 1, NULL, 'p-f-viers@orange.fr', NULL, 59, 'fenetre conducteur trafic 16', 'Bonjour,\r\n\r\nLe moteur de la fenêtre conducteur du Trafic 16 ne fonctionne plus la fenêtre reste ouverte alors que nous avons un transport à effectuer dans les pyrénéens demain départ 7h. Les pièces ont déjà été livrées et se trouvent dans le garage.\r\nMerci\r\n\r\nMurielle', 2, NULL, '0', NULL, 'HELP', 'EXTERIEUR', 'BLOCKING', '2022-02-16 13:21:10', '2022-02-17 16:52:20', NULL, 1, NULL, '2022-02-17 15:52:22', NULL),
(181, 1, 'TS2202-0161', '9rxzfca49glwwy2i', 47, NULL, NULL, 3, 63, 'SL et LL', 'Livraison et installation voir branchement\r\nlave linge et sèche linge à St Benoit', 2, NULL, '0', NULL, 'HELP', 'EXTERIEUR', 'NORMAL', '2022-02-17 18:37:00', '2022-02-17 18:37:26', NULL, 0, NULL, '2022-02-17 17:37:27', NULL),
(182, 1, 'TS2202-0162', 'p9lnwobg1pvn37nn', 1, NULL, NULL, 3, 9, 'pose porte de garage sectionnelle', 'pose porte de garage sectionnelle sur le garage de la maison du 140', 8, NULL, '100', NULL, 'HELP', 'EXTERIEUR', 'NORMAL', '2022-02-17 19:11:35', '2022-02-17 19:12:03', '2022-02-21 16:14:32', 0, NULL, '2022-02-21 15:14:32', NULL),
(183, 1, 'TS2202-0163', 'z25acwbd788idkrl', NULL, NULL, 'christian.menzato@wanadoo.fr', NULL, 5, 'sumup bloqué', 'le boiter SUMUP 105010132320 affiche à l\'allumage\r\nDEVICE BLOCKED. PLEASE CONTACT SUPPORT\r\nQue dois je faire?', 2, NULL, '0', NULL, 'HELP', 'EXTERIEUR', 'NORMAL', '2022-02-18 08:42:51', NULL, NULL, 1, NULL, '2022-02-21 13:33:18', NULL),
(185, 1, 'TS2202-0165', 'l1mvzvxgky4hr9m8', 1, NULL, 'p-f-viers@orange.fr', NULL, 9, 'fuite d\'eau', 'Fuite d\'eau sous le lavabo du labo. voir photo jointe.\r\nMerci\r\nNathalie', 8, NULL, '100', NULL, 'HELP', 'INTERIEUR', 'HIGH', '2022-02-18 11:41:07', '2022-02-18 17:00:16', '2022-02-21 17:24:04', 1, NULL, '2022-02-21 16:24:04', NULL),
(186, 1, 'TS2202-0166', 'v8prtr71px7had4v', 60, NULL, 'ota.ambulances@orange.fr', NULL, 56, 'PEINTURE LOCAL CHINON', 'BONJOUR,\r\n\r\nPOURRIEZ-VOUS REALISER LES PEINTURES INTERIEUR DES LOCAUX DE CHINON ?\r\n\r\nJE VOUS REMERCIE PAR AVANCE\r\n\r\nCORDIALEMENT\r\n\r\nSOPHIE', 2, NULL, '0', NULL, 'HELP', 'INTERIEUR', 'NORMAL', '2022-02-18 12:15:54', '2022-02-18 16:58:45', NULL, 1, NULL, '2022-02-18 15:58:59', NULL),
(187, 1, 'TS2202-0167', 'otyqemk4s55eju1n', 36, NULL, 'd.gourdet@ambu17.com', NULL, 63, 'DEMANDE D EQUIPEMENTS', 'pour aménager la cuisine régul Colbert, besoin d\'1 table ou d\'un meuble pour poser 1 cafetière et 1 micro-onde et 1 table pour la salle de formation.', 2, NULL, '0', NULL, 'HELP', 'EXTERIEUR', 'NORMAL', '2022-02-18 12:42:01', '2022-02-18 17:29:40', NULL, 1, NULL, '2022-02-18 16:29:41', NULL),
(188, 1, 'TS2202-0168', 'nc7mjoz5qs2tiv14', 38, NULL, 'ad.gourdet@ambu17.com', NULL, 63, 'DEMANDE D EQUIPEMENT', 'Afin d\'installer la plaque de cuisson aux Ambulances Chatel, il faudrait quelques modifications. de plus la chambre que l\'apprenti d\'HELENE va occuper ne ferme pas à clé, j\'ai expliqué à Thomas lors du dépannage chez Colbert, voir avec lui pour les détails', 2, NULL, '0', NULL, 'HELP', 'EXTERIEUR', 'NORMAL', '2022-02-18 13:00:26', '2022-02-18 17:05:10', NULL, 1, NULL, '2022-02-18 16:05:12', NULL),
(189, 1, 'TS2202-0169', 'o69pcmc2sydbyfa6', NULL, NULL, 'd.gourdet@ambu17.com', NULL, 5, 'CAMERAS CHATEL + GEOLOC', 'Les régulateurs de Colbert souhaiteraient que les caméras de Chatel soient remises en fonction suite à des différents sur les horaires de débauche et que tous les véhicules soient équipés de géoloc le taxi ainsi que 2 VSL ne sont pas équipés et une ambulance ne fonctionne pas.\r\nEst-ce les caméras de Marotta peuvent être reliées à Colbert.', 2, NULL, '0', NULL, 'GPS', 'EXTERIEUR', 'NORMAL', '2022-02-18 14:13:27', NULL, NULL, 1, NULL, '2022-02-21 13:32:46', NULL),
(190, 1, 'TS2202-0170', 'ngkaq8fpnbvvfnqf', 39, NULL, 'd.gourdet@ambu17.com', NULL, 3, 'DEMANDE DE FOURNITURES', 'Pour les Ambulances Marotta, suite à l\'entretien du linge sur site, nous avons besoin d\'1 centrale vapeur, 1 minimum couture (fil, aiguille, épingle à nourrice, élastique et boutons pour pantalons)', 2, NULL, '0', NULL, 'HELP', 'EXTERIEUR', 'NORMAL', '2022-02-18 14:17:15', '2022-02-18 17:01:43', NULL, 1, NULL, '2022-02-18 16:01:45', NULL),
(191, 1, 'TS2202-0171', 'po1th6ooo9b3ye6a', 77, NULL, NULL, 58, 5, 'GRAVURE PLAQUE IDENTITE DÉFUNT', 'Bonjour, \r\n\r\nImpossible de graver une plaque d\'indentité de cercueil avec la machine BRAUMAT EGX.', 8, NULL, '100', NULL, 'HELP', 'INTERIEUR', 'BLOCKING', '2022-02-18 14:56:50', '2022-02-18 19:12:19', '2022-02-21 14:32:34', 0, NULL, '2022-02-21 13:32:34', NULL),
(192, 1, 'TS2202-0172', 'gaycf7kmxjd1kje6', NULL, NULL, 'amb.asur@wanadoo.fr', NULL, 5, 'PROBLEME IMPRIMANTE CANON MG3650', 'Bonjour l\'imprimante CANON MG 3650 qui se trouve au bureau des Pompes Funèbres AZUR Rue du Dr Brillaud 79300 BRESSUIRE ne fonctionne plus, elle se mets en erreur, ils ne peuvent plus accéder pour le changement des cartouches : le bloc cartouches est bloqué. Code erreur 5B02.\r\n\r\nCordialement,', 2, NULL, '0', NULL, 'REQUEST', 'INTERIEUR', 'BLOCKING', '2022-02-18 16:33:21', NULL, NULL, 1, NULL, '2022-02-21 13:34:56', NULL),
